            .api-logo {
                width: 100%;
            }
            .api-content {
                top: 114px !important;
            }
        }
    </style>
</head>
<body>
    <redoc spec-url='api-docs' suppress-warnings></redoc>
    <script src=""Docs/Redoc/redoc.js"" > </script>
    <div class=""api-logo"">
        <img src=""data:image/png;base64,"" alt=""{title}"" />
    </div>
